import { Box } from "@mui/system";
import { useState } from "react";
import { useNavigate } from "react-router-dom";
import SMButton from "../config/components/button";
import SMInput from "../config/components/input";

function Login() {

const [inpVal,setInpVal] = useState({})

  const navigate = useNavigate();
  const loginUser = (inpVal) => {
    console.log("User Click Login");
    navigate("/", {
      state: {
        user: true,
      },
    });
  };
  return (
    <>
      <Box>
        <Box sx={{ padding: 1 }}>
          <SMInput onChange={(e)=>{setInpVal(e.target.value)}} label="Email" type="email" />
        </Box>
        <Box sx={{ padding: 1 }}>
          <SMInput onChange={(e)=>{setInpVal(e.target.value)}} label="Password" type="password" />
        </Box>
        <Box sx={{ padding: 1 }}>
          <SMButton onClick={loginUser} label="Login" />
        </Box>
      </Box>
    </>
  );
}
export default Login;
